	screenwidth DWORD 640 		;;given screen width	
	screenheight DWORD 480		;;given screen height
	
	mouse_x DWORD 320			;;store mouse coordinates
	mouse_y DWORD 100
	first_x DWORD 320
	first_y DWORD 400

	sprite_minion DWORD OFFSET minion 	;;Create minion sprite struct
	sprite_ball DWORD OFFSET basketball	;;create pokeball sprite struct
	sprite_map DWORD OFFSET court

	addr_mini DWORD OFFSET mini 		;;Store address of mini sprite
	mini Sprite <OFFSET minion, 320, 400, 10, 10> 	;;Create mini sprite
	addr_poke DWORD OFFSET poke 					;;Store address of poke sprite
	poke Sprite <OFFSET basketball, 320, 10, 10, 10>	;;Create poke sprite



	gameover BYTE "You lose!", 0
	ended DWORD 0

	rand DWORD 0

	time DWORD 0
	init BYTE "Score: 0", 0
	score BYTE "Score: %d", 0
	score_num DWORD 0
	paused_screen BYTE "Paused", 0
	is_paused DWORD 0
	paused DWORD 0
	lives DWORD 3

	incrm DWORD 0
	shake DWORD 0

.CODE

LeftClickPress PROC USES ebx ecx edx
	xor eax, eax					;;eax = 0
	mov ebx, MouseStatus.buttons	;;Mouse button clicked 
	cmp ebx, MK_LBUTTON				;;check if button is the left mouse
	je yes							;;if not return
	ret
yes:
	mov eax, 1
	mov ebx, MouseStatus.horiz		;;if so find the x and y coordinates
	mov ecx, MouseStatus.vert
	mov mouse_x, ebx				;;store those values in global variables
	mov mouse_y, ecx
	mov (Sprite PTR [esi]).horiz, ebx	;Then store them in sprite struct for the minion struct
	mov (Sprite PTR [esi]).vert, ecx
	ret
LeftClickPress ENDP

UpArrowPress PROC USES ebx ecx edx 	;;Check to see if the up arrow is pressed and return 1 if it is
									;;else return 0
	xor eax, eax
	mov ebx, KeyDown
	cmp ebx, VK_UP
	je yes
	ret
yes:	
	mov eax, 1
	ret
UpArrowPress ENDP

DownArrowPress PROC USES ebx ecx edx ;;Check to see if the down arrow is pressed and return 1 if it
									;;else return 0
	xor eax, eax
	mov ebx, KeyDown
	cmp ebx, VK_DOWN
	je yes
	ret
yes:	
	mov eax, 1
	ret
DownArrowPress ENDP

LeftArrowPress PROC USES ebx ecx edx ;;Check to see if the left arrow is pressed and return 1 if it is
									;;else return 0
	xor eax, eax
	mov ebx, KeyDown
	cmp ebx, VK_LEFT
	je yes
	ret
yes:	
	mov eax, 1
	ret
LeftArrowPress ENDP

RightArrowPress PROC USES ebx ecx edx ;;Check to see if the right arrow is pressed and return 1 if it is
										;;else return 0
	xor eax, eax
	mov ebx, KeyDown
	cmp ebx, VK_RIGHT
	je yes
	ret
yes:	
	mov eax, 1
	ret
RightArrowPress ENDP

P_press PROC USES ebx ecx edx
	mov eax, is_paused
	mov ebx, KeyPress
	cmp eax, 1
	je alternative
	cmp ebx, VK_P 
	je yes
	ret
yes:
	mov eax, 1
	mov is_paused, eax
	ret
alternative:
	cmp ebx, VK_P
	jne yes
	mov eax, 0
	mov is_paused, 0
	ret

P_press ENDP


;;Checkintersect checks to see if two objects are colliding

CheckIntersect PROC STDCALL oneX:DWORD, oneY:DWORD, oneBitmap:PTR EECS205BITMAP, twoX:DWORD, twoY:DWORD, twoBitmap:PTR EECS205BITMAP
	LOCAL min1:DWORD, max1:DWORD, min2:DWORD, max2:DWORD, min1_:DWORD, min2_:DWORD, max1_:DWORD, max2_:DWORD

	mov eax, 0 ;;stays 0 if it does crash

;;checks x direction
xcheck:
	mov ebx, oneX 	;;creates invisible rectangle to surround the sprite
	add ebx, 20
	mov max1, ebx
	sub ebx, 40
	mov min1, ebx
	mov ebx, twoX
	add ebx, 20
	mov max2, ebx
	sub ebx, 40
	mov min2, ebx

	mov ebx, max1
	mov ecx, min2
	sub ebx, ecx
	cmp ebx, 0
	jle check
	cmp ebx, 80
	jge check


;;checks y direction after checking the x direction
ycheck:
	mov ebx, oneY		;;creates invisible rectangle to surround the sprite in the y direction
	add ebx, 20
	mov max1_, ebx
	sub ebx, 40
	mov min1_, ebx
	mov ebx, twoY
	add ebx, 20
	mov max2_, ebx
	sub ebx, 40
	mov min2_, ebx

	mov ebx, max1_
	mov ecx, min2_
	sub ebx, ecx
	cmp ebx, 0
	jle check
	cmp ebx, 80
	jge check 
	ret

check:
	mov eax, 1 					;;Objects do not crash if eax is 1
	ret


CheckIntersect ENDP
