GameInit PROC
	LOCAL xcenter:DWORD, ycenter:DWORD

	mov edx, screenwidth
	sar edx, 1
	mov xcenter, edx
	mov edx, screenheight
	sar edx, 1
	mov ycenter, edx

	INVOKE BasicBlit, sprite_minion, xcenter, ycenter ;;create minion sprite to start with

	rdtsc
	invoke nseed,eax


	ret         ;; Do not delete this line!!!
GameInit ENDP


;;Dont mess with esi or edi
GamePlay PROC
begin:
	mov eax, ended
	cmp eax, 1
	je finished
	INVOKE P_press
	cmp eax, 0 
	je cont 
	INVOKE DrawStr, OFFSET paused_screen, 300, 220, 24ch 
	ret
cont:
	;; create a random horizontal location
	INVOKE nrandom, 640
	mov rand, eax

	;;store addresses of sprites in edi and esi
	xor eax, eax
	mov ecx, OFFSET minion
	mov edx, OFFSET basketball
	mov edi, addr_mini
	mov esi, addr_poke

start:
	INVOKE LeftClickPress 		;;store mouse coordinates when clicked
		
checkpoint:
	mov ebx, KeyPress			;;if nothing is pressed then return without doing anything
	cmp ebx, 0
	je finish

	INVOKE UpArrowPress			;;Jump to corresponding branch when one of the arrow keys is pressed
	cmp eax, 1	
	je up
	INVOKE DownArrowPress
	cmp eax, 1
	je down
	INVOKE LeftArrowPress
	cmp eax, 1
	je left
	INVOKE RightArrowPress
	cmp eax, 1
	je right
	ret


	;;for up, down, left, and right change the value of the sprite coordinate 
	;;and refresh the screen and invoking new blit sprite
up:	
	sub (Sprite PTR [edi]).vert, 0
	mov eax, (Sprite PTR [edi]).vert
	mov first_y, eax
	INVOKE BasicBlit, sprite_map, 300, 300		
	jmp finish
down:
	add (Sprite PTR [edi]).vert, 0
	mov eax, (Sprite PTR [edi]).vert 
	mov first_y, eax
	INVOKE BasicBlit, sprite_map, 300, 300
	jmp finish
left:
	sub (Sprite PTR [edi]).horiz, 15
	mov eax, (Sprite PTR [edi]).horiz
	mov first_x, eax
	INVOKE BasicBlit, sprite_map, 300, 300
	jmp finish
right:
	add (Sprite PTR [edi]).horiz, 15
	mov eax, (Sprite PTR [edi]).horiz
	mov first_x, eax
	INVOKE BasicBlit, sprite_map, 300, 300
	jmp finish

finish:
	;adds acceleration
	xor edx, edx
	mov eax, time
	;;only every other to slow down the drop
	mov ebx, 2
	idiv ebx
	;mov shake, edx ;;account for screen shaking
	cmp edx, 0
	je drop
	xor edx, edx
	mov eax, time
	idiv ebx

	
drop:
	;;drops the basketball downward
	add (Sprite PTR [esi]).vert, eax
	mov eax, time
	add eax, 1
	mov time, eax

	mov ebx, (Sprite PTR [esi]).horiz
	mov ecx, (Sprite PTR [esi]).vert


	;;shake screen
	mov eax, 0
	cmp eax, shake
	je skipped
	mov eax, shake
	mov ebx, offset court
	cmp eax, 5
	je shook2
	cmp eax, 4
	je shook 
	cmp eax, 3
	je shook2
	cmp eax, 2
	je shook
	cmp eax, 1
	je shook2
;;shake screen and alternate between shaking upward and shaking downward 
shook:
	add (Sprite PTR [ebx]).horiz, 5
	sub eax, 1
	jmp skipped
shook2:
	sub (Sprite PTR [ebx]).horiz, 5
	sub eax, 1
skipped:
	mov shake, eax
	;;overwrites the previous bitmap with other sprites with clear court bitmap
	INVOKE BasicBlit, sprite_map, 300, 300
	;;Creates minion at the given location
	INVOKE BasicBlit, sprite_minion, first_x, first_y
	;;Creates basketball at random location
	sub ecx, 20
	INVOKE BasicBlit, sprite_ball, ebx, ecx   ;;Draws basketball onto screen


	;;Increments score based on collision 
	rdtsc
	mov eax, score_num
	push eax
	push OFFSET score
	push OFFSET outStr
	call wsprintf
	add esp, 12
	INVOKE DrawStr, OFFSET outStr, 20, 20, 24ch

	;;Check to see if minion caught the ball
	INVOKE CheckIntersect, (Sprite PTR [edi]).horiz, (Sprite PTR [edi]).vert, (Sprite PTR [edi]).object, (Sprite PTR [esi]).horiz, (Sprite PTR [esi]).vert, (Sprite PTR [esi]).object
	cmp eax, 0
	je win ;;continue to win if caught otherwise...
	;;cycle through or if the ball reaches the ground then jump to done
	mov eax, (Sprite PTR[esi]).vert
	cmp eax, 480
	jge done
	ret
win:
	mov shake, 6

	
	;;rewarding bell sound
	invoke PlaySound, OFFSET Ding, 0, SND_ASYNC
	;;increment score
	add score_num, 1
	;;start over at GamePlay
	jmp cycle
cycle:
	;;remake and restart the location of the new basketball
	mov time, 0
	mov (Sprite PTR [esi]).vert, 0
	;; rand will be used to give the new basketball a new starting drop location
	mov ebx, rand

	;;account for far left and right cases
	;;if horiz is less than 15 or greater than 630 then reduce...
	mov eax, 20
	cmp eax, ebx
	jle moved
	add ebx, 20
moved:
	mov eax, 620
	cmp eax, ebx
	jge moved2
	sub ebx, 20
moved2:
	;;give the basketball a new starting location
	mov (Sprite PTR [esi]).horiz, ebx
	ret
done: 
	;; end the game
	invoke DrawStr, OFFSET gameover, 280, 200, 24ch
	mov ended, 1
	ret
finished:

	ret
GamePlay ENDP

